import React from 'react';
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props);
  }

  getData () {
    const ENDPOINT = 'http://hp-api.herokuapp.com/api/characters';

    fetch(ENDPOINT)
    .then(res=>res.json())
    .then(data => {
      return console.log(data);
    })
  }
  render() {
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
